import React from "react";
import "./boxExamples.css";

export default function BoxExamples() {
  const examples = document.querySelectorAll(".example");
  examples.forEach((example) => {
    example.addEventListener("click", (e) => {
      navigator.clipboard.writeText(
        `box-shadow: ${window.getComputedStyle(e.target).boxShadow}`
      );
    });
  });
  return (
    <div className="examplesWrapper mt-5">
      <h2>Box Shadow Examples :</h2>
      <div className="Boxcontainer">
        <div className="row">
          <div className="example box-1">#01</div>
          <div className="example box-2">#02</div>
          <div className="example box-3">#03</div>
          <div className="example box-4">#04</div>
          <div className="example box-5">#05</div>
          <div className="example box-6">#06</div>
          <div className="example box-7">#07</div>
          <div className="example box-8">#08</div>
        </div>
      </div>
    </div>
  );
}
